import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="AutoDiff">
        <div className="Operators">
          <button>Log</button>
          <button>Sin</button>
          <button>Cos</button>
          <button>+</button>
          <button>-</button>
          <button>/</button>
          <button>*</button>
          <button>^</button>
        </div>

      </div>
    </div>
  );
}

export default App;
